import { useRef, useState, useEffect } from "react";
import axios from 'axios';

const Profile = () => {
    axios.interceptors.request.use(
        config => {
            config.headers.authorization = localStorage.getItem('token');//`Bearer_eyJhbGciOiJIUzI1NiJ9.eyJzdWIiOiJ0ZXN0MUBnbWFpbC5jb20iLCJyb2xlcyI6WyJVU0VSIl0sImlhdCI6MTY1NzUwNTA1OCwiZXhwIjoxNjU3NTQxMDU4fQ.u6t2MGBJhhwfzYUNsQlfKzfscL3D7dzsH7PWZcCGHvc`
            return config;
        },
        error => {
            return Promise.reject(error);
        }
    )

    const fetchCurrentUserProfile = () => {
        axios.get("http://localhost:8080/profile").then(res => {
            console.log(res);
        })
    }

    useEffect(() => {
        fetchCurrentUserProfile();
    }, [])

    return <h1>Hello</h1>
}

export default Profile;
